sys_variable_value.value:
(function execute(inputs, outputs) {

  var now = new GlideDate();
  var nowFormatted = now.getByFormat("MM/dd/yyyy");
  var nowPlus30 = new GlideDate(now);
  nowPlus30.addDaysLocalTime(30);

  // Have not implemented Eval Plan yet, so cannot determine LPTA vs BVTO yet; hard-coding PALT to 30 for now
  var palt = parseInt(inputs.palt_code.toString());
  var corEmail = null;
  var corLastName = null;
  var corFirstName = null;

  //var igce = null;
  var estCurrentFyObl = null;
  var igce = new Igce(inputs.acquisition_package);   
  var dummyFunding = [
    {
      fundingDocId: "DUMMYFORM9",
      fundingType: "",
      fundingTypeCode: "",
      purchaseRequest: "",
      fundId: 62277,
      fundSeqId: 1,
      fundLineId: 0,
      availableFunds: 0,
      safBaseAmount: 0,
      prNumber: "",
      createdBy: "",
      returnMsg: ""
    }
  ];

  var corContact = inputs.acquisition_package.cor;
  var corEmail = corContact && corContact.email ? corContact.email.toString() : "";
  var corFirstName = corContact && corContact.first_name ? corContact.first_name.toString() : "";
  var corLastName = corContact && corContact.last_name ? corContact.last_name.toString() : "";
  var corExtension = corContact && corContact.phone_extension ? corContact.phone_extension.toString() : "";
  var corAreaCode = null;
  var corExchange = null;
  var corNumber = null;
  if (corContact && corContact.phone) {
    var phone = corContact.phone.toString();
    if (phone.length == 12) {
      corAreaCode = phone.slice(2, 5);
      corExchange = phone.slice(5, 8);
      corNumber = phone.slice(8, 12);
    }    
  }

  outputs.body = JSON.stringify({
    actionablePackageReceivedDate: nowFormatted,
    awardBySept30: "Y",
    awardRisk: "Low",
    createdBy: "ATAT",
    createdByUserId: parseInt(gs.getProperty("x_g_dis_atat.css.createdByUserId")),
    description: inputs.acquisition_package.project_overview.scope.toString(),
    dodDoTo: "Y",
    draftPackageReceivedDate: nowFormatted,
    estCurrentFyObl: parseInt(inputs.base_year_total_estimate),
    igce: parseInt(inputs.total_estimate),
    lifeCycleAmount: parseInt(inputs.total_estimate),
    paltCode: palt,
    piin: "",
    projAwardDate: nowPlus30.getByFormat("MM/dd/yyyy"),
    title: inputs.acquisition_package.project_overview.title.toString(),
    typeAction: "D",
    vehicleCode: "JWCC",
    setAsideForSmallBiz: "NO",
    issuedByAgency: 16,
    issuedByOrg: 378,
    issuedByContSpec: 78644,
    issuedByKo: 78644,
    issuedByRespOfcCode: "PL85",
    officeCode: "PL85",
    jaInd: "N",
    customerPocType: "CONTORDCUST",
    customerAgency: parseInt(inputs.acquisition_package.organization.agency.css_id.toString()),
    customerEmail: corEmail,
    customerPocLastName: corLastName,
    customerPocFirstName: corFirstName,
    customerAreaCode: corAreaCode,
    customerExch: corExchange, 
    customerNumber: corNumber,
    customerExt: corExtension,
    funding: null
  });
})(inputs, outputs);

