sys_variable_value.value:
(function execute(inputs, outputs) {
  var getPalt = function() {
    var ap = new GlideRecord("x_g_dis_atat_acquisition_package");
    ap.get(inputs.acquisition_package);
    var ep = new GlideRecord("x_g_dis_atat_evaluation_plan");
    ep.get(ap.evaluation_plan.toString());
    var fo = new GlideRecord("x_g_dis_atat_fair_opportunity");
    fo.get(ap.fair_opportunity.toString());
    var totalEstimate = inputs.total_estimate;

    if (!fo || !fo.exception_to_fair_opportunity) {
      throw "Expected this package (" + ap.sys_id + ") to have a Fair Opportunity record with an Exception to Fair Opportunity attribute";
    }

    var noExceptionToFairOpportunity = (fo.exception_to_fair_opportunity.toString() == "NO_NONE");
    var underTenMillion = (totalEstimate < 10000000);

    if (noExceptionToFairOpportunity) {
      if (!ep || !ep.source_selection) {
        throw "Expected this package (" + ap.sys_id + ") to have an Eval Plan with a source_selection attribute.";
      }
      var sourceSelection = ep.source_selection.toString();
      var method = ep.method.toString();

      if (sourceSelection == "NO_TECH_PROPOSAL") {
        return underTenMillion ? 39: 40;
      }
      if (sourceSelection == "TECH_PROPOSAL" && method == "LPTA") {
        return underTenMillion ? 41: 42;
      }
      if (sourceSelection == "TECH_PROPOSAL" && method == "BVTO") {
        return underTenMillion ? 43: 44;
      }
      if (sourceSelection == "SET_LUMP_SUM") {
        return underTenMillion ? 45: 46;
      }
      if (sourceSelection == "EQUAL_SET_LUMP_SUM") {
        return underTenMillion ? 47: 48;
      }
    }
    else {
      return underTenMillion ? 49: 50;
    }
  }

  outputs.palt_code = getPalt();
})(inputs, outputs);

